Empty.description:
A generic empty message that you can re-use to avoid defining duplicated
empty messages in your APIs. A typical example is to use it as the request
or the response type of an API method. For instance:

    service Foo {
      rpc Bar(google.protobuf.Empty) returns (google.protobuf.Empty);
    }

The JSON representation for `Empty` is empty JSON object `{}`.

GoogleCloudSecuritycenterV1p1alpha1Prope.description:
Message used to define the format of a single property value's type in a
Finding. If the type of the value is a struct, the struct_value map will have
the same keys as the struct. If the type of the value is a list, all fields
inside the list will be enforced to have the same type, so only a single type
will be present for all values in the list. e.g:
P1: {
   x: number_value: 123,
   y: string_value: "some string",
   z: bool_value: True,
   a_list: list_value: values: number_value: 123, number_value: 234
   a_list_of_lists:
     list_value:
       values:
         list_value: values: number_value: 123, number_value: 234
         list_value: values: bool_value: true
         list_value: values: string_value: "abc", string_value: "def"
} would be represented as:
{
 data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED,
 struct_value: {
   x: {
     data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED,
     primitive_data_type: NUMBER,
   }
   y: {
     data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED,
     primitive_data_type: STRING,
   }
   z: {
     data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED,
     primitive_data_type: BOOL,
   }
   a_list: {
     data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED,
     list_values: [
       {
         data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED
         primitive_data_type: NUMBER
       }
     ]
   }
   a_list_of_lists: {
     data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED,
     list_values: [
       {
         data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED
         list_values: [
           {
             data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED
             primitive_data_type: NUMBER
           },
           {
             data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED
             primitive_data_type: BOOL
           }
           {
             data_type: DATA_TYPE_TAXONOMY_UNSPECIFIED
             primitive_data_type: STRING
           }
         ]
       }
     ]
   }
 }
}

AuditConfig.description:
Specifies the audit configuration for a service.
The configuration determines which permission types are logged, and what
identities, if any, are exempted from logging.
An AuditConfig must have one or more AuditLogConfigs.

If there are AuditConfigs for both `allServices` and a specific service,
the union of the two AuditConfigs is used for that service: the log_types
specified in each AuditConfig are enabled, and the exempted_members in each
AuditLogConfig are exempted.

Example Policy with multiple AuditConfigs:

    {
      "audit_configs": [
        {
          "service": "allServices"
          "audit_log_configs": [
            {
              "log_type": "DATA_READ",
              "exempted_members": [
                "user:jose@example.com"
              ]
            },
            {
              "log_type": "DATA_WRITE",
            },
            {
              "log_type": "ADMIN_READ",
            }
          ]
        },
        {
          "service": "sampleservice.googleapis.com"
          "audit_log_configs": [
            {
              "log_type": "DATA_READ",
            },
            {
              "log_type": "DATA_WRITE",
              "exempted_members": [
                "user:aliya@example.com"
              ]
            }
          ]
        }
      ]
    }

For sampleservice, this policy enables DATA_READ, DATA_WRITE and ADMIN_READ
logging. It also exempts jose@example.com from DATA_READ logging, and
aliya@example.com from DATA_WRITE logging.

AuditLogConfig.description:
Provides the configuration for logging a type of permissions.
Example:

    {
      "audit_log_configs": [
        {
          "log_type": "DATA_READ",
          "exempted_members": [
            "user:jose@example.com"
          ]
        },
        {
          "log_type": "DATA_WRITE",
        }
      ]
    }

This enables 'DATA_READ' and 'DATA_WRITE' logging, while exempting
jose@example.com from DATA_READ logging.

pageToken.description:
The value returned by the last `ListFindingPropertyNamesResponse`;
indicates that this is a continuation of a prior `ListFindingPropertyNames`
call, and that the system should return the next page of data.

The value returned by the last `ListAssetPropertyNamesResponse`;
indicates that this is a continuation of a prior `ListAssetPropertyNames`
call, and that the system should return the next page of data.
